import React, { useEffect, useState } from 'react';
import './styles.css';
import logoImg from '../../assets/logo.svg';
import { Link, useHistory } from 'react-router-dom';
import { FiArrowLeft } from 'react-icons/fi';

export default function NewIncident(){
    const history = useHistory();
    const [title, setTitle] = useState('');
    const [description, setDescription] = useState('');
    const [value, setValue] = useState('');

    return (
        <div className="new-incident">
        <div className="content">
            <section>
                <img src={logoImg} alt="Be The Hero"/>
                <h1>Cadastrar Novo Caso</h1>
                <p>Descreva o caso detalhadamente para encontrar um herói para resolver isso.</p>
                <Link className="black-link" to="/profile">
                    <FiArrowLeft size={16} color="#e02041"/>
                    Voltar Para Home
                </Link>
            </section>
            <form>
                <input type="text" placeholder="Título do caso" value={title} onChange={e => setTitle(e.target.value)}/>
                <textarea placeholder="Descrição" value={description} onChange={e => setTitle(e.target.value)}></textarea>
                <input type="email" placeholder="Valor em Reais" value={value} onChange={e => setValue(e.target.value)}/>
                <button className="button" type="submit">Cadastrar</button>
            </form>
        </div>
    </div>
    );
}
